import React from 'react'
import * as s from "./styles.js"
import frame from "../../img/frame.png"

export function Header() {
    return (
        <s.Wrapper>
			<s.HeaderText>
                <s.Title>Spaceship News Portal</s.Title>
                <p>Welcome to the most innovative news platform that will let you stay informed about the high-technology world of spaceship.</p>
            </s.HeaderText>
            <s.DesktopImage src={frame} alt="Desktop image"/>
		</s.Wrapper>
    )
};
